Presenting another one of the most-suggested videos on my profile finally 💫

I have a combination skin which is also sensitive and I am very conscious about following a proper routine always. I follow three different skincare routines throughout the day and this is my unfiltered, morning skincare routine. Also, I drink 1-2 glasses of water on an empty stomach every morning apart from staying hydrated all day and I feel that makes the biggest difference💖

